import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return (
      <div style={{display:'flex',padding:'0.5'}}>
       <Link ><h1>Movies app</h1></Link>
        <h2 style={{marginLeft:'2rem',marginTop:'1.5rem'}}>Favourites</h2>
      </div>
    )
  }
}
